import Loader from 'react-loaders';
import p1 from ''

const Projects = () => {
  return (
    <>
      <div className="container project-page">
        <h1>My Projects</h1>
        <div className="projects">
          <div className="project-col">
            <a href="https://github.com/Madhura-saw/PLANit">
              <img src={p1} alt="" />
